package org.example.model;import jakarta.persistence.*;@Table@Entity(name = "branches")public class Branch {    @Id    @Column(name = "ifscCode", nullable = false, unique = true, length = 16)    private String ifscCode;    @Column(name="branchName")    private String branchName;    @Column(name="place")    private String place;    @Column(name="taluk")    private String taluk;    @Column(name="district")    private String district;    @Column(name="state")    private String state;    @Column(name="pincode")    private String pincode;    public String getIfscCode() {        return ifscCode;    }    public void setIfscCode(String ifscCode) {        this.ifscCode = ifscCode;    }    public String getBranchName() {        return branchName;    }    public void setBranchName(String branchName) {        this.branchName = branchName;    }    public String getPlace() {        return place;    }    public void setPlace(String place) {        this.place = place;    }    public String getTaluk() {        return taluk;    }    public void setTaluk(String taluk) {        this.taluk = taluk;    }    public String getDistrict() {        return district;    }    public void setDistrict(String district) {        this.district = district;    }    public String getState() {        return state;    }    public void setState(String state) {        this.state = state;    }    public String getPincode() {        return pincode;    }    public void setPincode(String pincode) {        this.pincode = pincode;    }}